css:
.deprecation-cop {
  overflow: auto;
  -webkit-flex: 1;
  background-color: #073642 !important;
}
.deprecation-cop .deprecation-info {
  padding: 0 10px;
}
.deprecation-cop .deprecation-info:hover {
  background-color: #094959 !important;
}
.deprecation-cop .collapsed > ul {
  display: none;
}
.deprecation-cop .list {
  list-style-type: none;
  padding: 0;
}
.deprecation-cop .stack-trace {
  background-color: #00222d;
  padding: 10px;
  margin-bottom: 10px;
}
.deprecation-cop a {
  color: #fdf6e3;
}
